import React, {useState} from 'react'

const Welcome = () => {
    const [status, setStatus] = useState(false)

    return(
        status ? (
        <h1>Hello India!</h1>
        ) : (
            <h1>Hello World!</h1>
        )
    )
}

export default Welcome
